                        {result.formula}
                        <Spacer y={1} />
                        <Text size="$xs">{result.resultado}</Text>
                    </Text>
                        <Button shadow color="gradient" auto onClick={handler}>
                            Ver formulas
                        </Button></>
                )
                    : (<Text blockquote>Completar datos.</Text>)}
            </Card.Body>
        </Card>
        <Modal
        closeButton
